webpackJsonp([1160],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-stringprototypeslice.json":function(e,n){e.exports={data:{markdownRemark:{html:'<p>The JavaScript string method <code>.slice()</code> extracts a portion of a string and returns a new string.</p>\n<h2>Syntax</h2>\n<pre><code>str.slice(beginSliceIndex[, endSliceIndex]);\n</code></pre>\n<h2>Parameters</h2>\n<p><strong>beginSliceIndex</strong></p>\n<p>The zero-based index where the slice should begin. If beginSliceIndex is a negative number, <code>.slice()</code> counts backwards from the end of the string to determine where to begin the slice.</p>\n<p><strong>endSliceIndex</strong></p>\n<p>Optional. The zero-based index where the slice should end. If omitted, <code>.slice()</code> extracts to the end of the string.</p>\n<h2>Description</h2>\n<p><code>.slice()</code> slices the text out of one string and returns a new string.</p>\n<h2>Examples</h2>\n<p><strong>Using <code>.slice()</code> to create a new string</strong></p>\n<pre><code>var string1 = "Hello World!";\nvar string2 = string1.slice(3);\nconsole.log(string2);                           // Will log "lo World!"\n\nvar string3 = string1.slice(3, 7);\nconsole.log(string3);                           // Will log "lo W"\n</code></pre>\n<p><strong>Using <code>.slice()</code> with negative indices</strong></p>\n<pre><code>var string = "Hello World!"\nstr.slice(-3);                                  // Returns "ld!"\nstr.slice(-3, -1);                              // Returns "ld"\nstr.slice(0, -1);                               // Returns "Hello World"\n</code></pre>\n<p>Source <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/slice">MDN</a></p>',frontmatter:{title:"javaScript Stringprototypeslice",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-stringprototypeslice/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-stringprototypeslice/"}}}});
